import React from 'react';
import { CardImg, CardText, CardBody,  CardSubtitle } from 'reactstrap';

export function Homee () {
    return (
      <div>
        <CardImg top id="cardimage"  width="100%" src="../assets/hossik.jpeg" alt="hossik" />
        <CardBody>
          <CardSubtitle >Hello, My Name is Hossik</CardSubtitle>
          <CardText id="cardtext" className='row justify-content-center'>

        </CardText>
        </CardBody>
      </div>
    )
  }
export default Homee;
